.list-group {
	display: flex;
	flex-direction: column;
	min-height: 20px;
	box-sizing: border-box;
}
.list-group-item {
	position: relative;
	display: block;
	padding: 0.4rem 1.25rem;
	background-color: #fff;
	border: 1px solid rgba(0, 0, 0.125);
	cursor: move;
}

.human {
	background-color: lightpink;
}
.truck {
	background-color: goldenrod;
}
.list-group-item:last-child {
	margin-bottom: 0;
	border-bottom-right-radius: 0.25rem;
	border-bottom-left-radius: 0.25rem;
}
.list-group-item:first-child {
	border-top-left-radius: 0.25rem;
	border-top-right-radius: 0.25rem;
}
.map-container {
	height: 300px;
	width: 100%;
}
/* Add any custom styles for your map container here */
#map {
	height: 100%;
	width: 99%;
	margin: 0 auto;
}
.plugins-tips {
	padding: 3px 0;
	text-align: center;
	font-size: 1.2rem;
}

.drag-box {
	display: flex;
	user-select: none;
}
.drag-box-item {
	box-sizing: border-box;
	flex: 1;
	max-width: 260px;
	min-width: 120px;
	background-color: #eff1f5;
	margin-right: 16px;
	border-radius: 6px;
	border: 1px #e1e4e8 solid;
	padding: 0.5rem 0.7rem;
}
.item-title {
	padding: 8px 8px 8px 12px;
	font-size: 14px;
	line-height: 1.5;
	color: #24292e;
	font-weight: 600;
}
.item-ul {
	padding: 0 8px 8px;
	height: 500px;
	overflow-y: scroll;
}
.item-ul::-webkit-scrollbar {
	width: 0;
}
.drag-list {
	border: 1px #e1e4e8 solid;
	padding: 10px;
	margin: 5px 0 10px;
	list-style: none;
	background-color: #fff;
	border-radius: 6px;
	cursor: pointer;
	-webkit-transition: border 0.3s ease-in;
	transition: border 0.3s ease-in;
}
.drag-list:hover {
	border: 1px solid #20a0ff;
}
.drag-title {
	font-weight: 400;
	line-height: 25px;
	margin: 10px 0;
	font-size: 22px;
	color: #1f2f3d;
}
